import myPortait from '../assets/martin-hodsman-2020.jpg';

export const info = [
    {
        id: 1,
        title: "Hello, it's me!",
        content: 'I am Martin and I love to learn. For some time, coding is my passion. This is my latest project. I completed it to gain experience and to entertain you.',
        image: myPortait,
        alt: 'Martin Hodsman (2020)'
    },
    {
        id: 2,
        title: "That's my tech stack!"
    },
    {
        id: 3,
        title: 'How did I build this app?'
    },
    {
        id: 4,
        title: 'What was my biggest challenge?'
    },
    {
        id: 5,
        title: 'What was my biggest learning?'
    },
    {
        id: 6,
        title: 'Where to find me?'
    }
];
